import React from 'react'
import {Link} from 'react-router-dom'
import {useSelector} from 'react-redux';
import {logout} from '../../actions/auth'
export const Navbar = () => {
    const auth=useSelector(state=>state.auth);
    const {isAuthenticate,isLoading}=auth;
    const authLinks=(
        <ul>
           
            <li>
                <Link to="/" onClick={logout}>
                    <i className="fas fa-sign-out-alt" ></i>
                    <span className="hide-sm">Logout</span></Link>
            </li>
        </ul>

    )
    const guestLinks=(
        <ul>
            <li><Link to="/profile">Developers</Link></li>
            <li><Link to="/register">Register</Link></li>
            <li><Link to="/login">Login</Link></li>
        </ul>
    )
    return (
        <nav class="navbar bg-dark">
        <h1>
            <Link to="/"><i class="fas fa-code"></i> DevConnector</Link>
        </h1>
        {!isLoading && (<>{isAuthenticate ? authLinks : guestLinks}</>)}
    </nav>
    )
}
